html, body {
    margin: 0px;
    padding: 0px;
    overflow: hidden;
}

@keyframes spin {
    0% { transform: translate(-50%, -50%) rotate(0deg); }
    100% { transform: translate(-50%, -50%) rotate(360deg); }
}

#progress {
    position: absolute;
    left: 50%;
    top: 50%;
    border: 16px solid rgba(0, 0, 0, 0.8);
    border-top: 16px solid rgba(200, 200, 200, 0.8);
    border-radius: 50%;
    width: 50px;
    height: 50px;
    animation: spin 2s linear infinite;
    z-index: 10;
}

.container {
    width: 100%;
    height: 100%;
    overflow: hidden;
    position: relative;

    display: flex;
}

.title {
    position: absolute;
    color: #ccc;
    font-size: 28px;
    text-align: center;
    padding: 20px 40px;
    border-radius: 10px;
    left: 50%;
    top: 25%;
    margin-left: -25%;
    background-color: rgba(0, 0, 0, 0.8);
    z-index: 10;
    font-weight: bold;
}

.animation-container {
    width: 100%;
    height: 100%;
    position: absolute;
    top: 0;
}

.frameset {
    position: absolute;
    display: flex;
}

.frameset.bottom-obj {
    bottom: 0;
}

.frameset.bottom-obj.animation-frame {
    bottom: 110px;
}

.frameset.top-obj.animation-frame {
    top: 10px;
}

.frameset.bottom-obj.animation-frame > .obj-1 {
    position: absolute;
}

.frameset.bottom-obj.animation-frame .invisible,
.frameset.top-obj.animation-frame .invisible {
    display: none;
}
